import React from 'react';

const Login = (props) => {
    return (
        <div>
            <h1>Login</h1>
            <div>
                <input placeholder={'login'}/>
                <input placeholder={'password'}/>
                <input type={'checkbox'}/> Remember me
            </div>
        </div>
    )
}

export default Login;
